INSERT INTO `rsrch_events` (`id`, `name`, `date`, `details`, `image`, `collage`, `link`, `type`, `excel`) VALUES
(1, 'Leaders in Action', '2018-07-03', '&lt;p&gt;&lt;strong&gt;“Leaders in Action – Celebration of Inspiration, Knowledge and Giving”&lt;/strong&gt;, event was organized to commemorate the 90th birthday celebrations of Dr. ARK Pillai, Founder of Indian Development Foundation (IDF) on Tuesday, 3rd of July 2018 at Shri Shanmukhananda Fine Arts &amp;amp; Sangeetha Sabha, Mumbai.&lt;br&gt;The event was Graced by many Leaders :&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Former Principal Scientific Adviser, Govt of India and Nuclear Scientist Dr. R Chidambaram&lt;/li&gt;&lt;li&gt;IPS former Director General of Police Shri D Sivanandan&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;Many faculties and students of SAKEC attended the event and got motivated by Leaders.&lt;/p&gt;', 'img_5c909d99ed3624.82768362.png', 'col_5c90aaaef34590.72954194.jpg', 'https://www.facebook.com/media/set/?set=a.924265897752728.1073742017.474323859413603&type=1&l=78d6739d52', 'completed', NULL),
(2, 'ME BECOMES WE: Together to Build a Strong Nation', '2018-08-04', '&lt;p&gt;The event &lt;strong&gt;“ME BECOMES WE: Together to Build a Strong Nation”&lt;/strong&gt; to celebrate the collaboration of SAKEC with Indian Development Foundation (IDF) &amp;amp; Roti Bank Mumbai was organised on 4th August 2018. IT was graced by Dr. Narayan B. Iyer, CEO &amp;amp; National Co-ordinator (Mumbai) (Indian Development Foundation), Shri D Sivanandan IPS (Retd.) Former Director General of Police (Mentor and Founder of (Roti Bank Mumbai), Mr. Shashank Shetty Hon. Director (Indian Development Foundation) Education Projects &amp;amp; Project Lead (Larsen &amp;amp; Toubro Infotech), Ms. Shriya Kumar Strategy Advisor (Roti Bank Mumbai) &amp;amp; Derivatives Sales and Structuring (JPMorgan Chase), Mr. Amit Sarkar Project Manager –Social Responsibility (Indian Development Foundation), Mr. Bhavesh Adhia&lt;/p&gt;&lt;p&gt;&lt;i&gt;COMING TOGETHER IS…BEGINNING&lt;/i&gt;&lt;br&gt;&lt;i&gt;BEING TOGETHER IS… PROGRESS&lt;/i&gt;&lt;br&gt;&lt;i&gt;WORKING TOGETHER IS …SUCCESS&lt', 'img_5c978f2bc745c6.34133607.png', 'col_5c978f2bca3bc3.35471803.jpg', 'https://www.facebook.com/media/set/?set=a.956650001180984.1073742037.474323859413603&type=1&l=74dfdc2022', 'completed', NULL),
(3, 'Student Leadership Program by IDF', '2018-09-19', '&lt;p&gt;&quot;Student Leadership Program by Indian Development Foundation &quot; was conducted on 19th September 2018 at SAKEC under the umbrella of &quot;ME becomes WE - together to build a strong Nation&quot;. We had excellent speakers, Ms Mallika Ramchandran and Mr.Roshan D\'souza from Indian Development Foundation who are experienced SLP co-ordinators. The co-ordinators conducted the session for our students on how they can become mentors and help IDF and thus the nation, in achieving their goal of teaching the underprivileged children. The session was truly inspiring as the students were looking forward to get real time exposure of mentoring.The speakers also assured the students that this would be a life-changing experience for them to give back to the society and lead a successful, satisfying and happy life in true sense. The session was appreciated by the students who thanked the speakers as well as college and faculty for conducting such a diverse session for them. Speakers were given positive assurance about SAKEC\'s collaboration with IDF which will bear sweet results to build a strong society and Nation.&lt;/p&gt;', 'img_5c979045bd4a95.64107449.jpg', 'col_5c979045bdba75.29314205.jpg', 'https://www.facebook.com/pg/shahanchor/photos/?tab=album&album_id=991500344362616', 'completed', NULL),
(4, 'Daan Utsav 2018', '2018-10-26', '&lt;p&gt;SAKEC in collaboration with Roti Bank Mumbai celebrated &lt;strong&gt;“Daan Utsav 2018”&lt;/strong&gt; on 26th October 2018 at Sulabha Special School, Tilaknagar. The event was a great success with the whole hearted efforts of college staff and student volunteers who donated food items like Daal, rice and bournvita packets to the underprivileged school children. The event was coordinated by Prof. Asha Durafe and Prof. Pinky Vishwakarma&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;SAKEC staff members Prof. Dhanashree Toradmalle., Prof. Manoj Dhande, Dr. Nilakshi Jain, Prof. Bhakti Sonawane, Prof. Manisha Mane, Prof. Nibha Desai, Prof. Aparajita Bera, Prof. Seema Kawale and Prof. Radhika Fulzele along with many students enjoyed the moment of giving.&lt;/p&gt;', 'img_5c9790c8002017.87567655.jpg', 'col_5c9790c800a841.63831280.jpg', 'https://www.facebook.com/shahanchor/photos/a.1012815378897779/1012816572230993/?type=3&theater', 'completed', NULL),
(5, ' Diving into Deep Learning 			', '2018-09-01', '&lt;p&gt;Students and faculties of SAKEC got an opportunity of Diving into Deep Learning on 1st and 2nd September of 2018.&amp;nbsp;&lt;br&gt;&lt;br&gt;The hands-on session were conducted under the umbrella of ME becomes WE: Together to build a Strong Nation by Dr. Kranti Ghag , Ms. Jalpa Mehta , Mr. Milind Khairnar and Ms Vaishali Hirlerkar .&lt;br&gt;&lt;br&gt;On the last day of event online quiz was conducted and Rohit Mutalik secured first place with 20/20 marks and Poojan Sanghvi stood second with 19/20 marks. Both were appreciated with mementos.&amp;nbsp;&lt;br&gt;&lt;br&gt;Focussed group of students and faculty members participated and also expressed that such events should be conducted oftenly.&lt;br&gt;&lt;br&gt;Feedback inspired us to take this journey ahead …..Surprise will be announced soon.&lt;/p&gt;', 'img_5ca43cd2a8d174.41221280.jpg', 'col_5ca43cd2a8fa01.89703523.jpg', 'https://www.facebook.com/media/set/?set=a.983121705200480&type=1&l=fa0f0c267d', 'completed', NULL),
(6, 'Celebration of Collaboration with Project Launch			', '2019-02-02', '&lt;p&gt;Celebration of Collaboration with Project Launch 2nd Feb, 2019 Shah &amp;amp; Anchor Kutchhi Engineering College, Chembur has collaborated with Indian Development Foundation, Bennett University, Roti Bank Mumbai, Bombay Leprosy Project (BLP), Waggy Tails Private Limited and Digital Freedom Foundation (DFF) to let students develop ideas and work on real life projects which have the potential to benefit the society in numerous ways. These projects were launched on 2nd February 2019, in the honorary presence of the Chief Guest, Mr. Boman Irani, widely acclaimed Indian actor. The event began with Deep Prajwalan and a prayer. Mr. Irani was heartily welcomed and felicitated by the Chairman, Shri Keshavjibhai Chhadva, Principal Dr. Bhavesh Patel and Research Coordinator Dr Nilakshi Jain. Inspiring speech by Mr.Irani explaining the virtue of humility in one’s life, left the audience in deep thoughts. Dignitaries were felicitated and presented with tokens of appreciation. The dignitaries included Mr. Boman Irani, widely acclaimed Indian actor Mr.D. Sivanandan, ex-DGP Maharashtra and convener of Roti Bank, Shri Sushil Jiwrajka, Trustee, Roti Bank, Dr.Narayan Iyer, CEO &amp;amp; National Co-ordinator (Mumbai) IDF, Wg Cdr S Balasubramaniam, Retired IAF, Treasurer IDF Dr.Ashish Kodke chief doctor at BLP, Ms Parul Negi, BLP Mr. Rahul, BLP Mr. Deshpande, BLP Mr.Shashank Shetty, Hon. Director IDF Education Projects &amp;amp; Project Lead (Larsen &amp;amp; Toubro Infotech) Mr. Abhishek Kateliya , Rotibank mumbai Mr. Anish Paliwal, IDF Social Ambassador Mr.Krishnakant Mane, Founder, DFF Ms. Prajakta Patkar, Project Leader, DFF Mr. Abhijit Balan, Manager, DFF Mr.Yash Sheth, Director Waggy Tails Private Limited The dignitaries launched the projects live amongst great excitement and cheer. All dignitaries expressed joy over the hardwork and dedication shown by team of SAKEC. A total of 7 projects were launched consisting of Roti Bank App Roti Bank Test before Taste IDF Web of Hope web application IDF Speed Ambulance App BLP Electronic Health Record Management System IDF Fire Fighter Robot IDF Breathe Clean Project The celebration was complemented with a moving mix of songs performed by students of SAKEC. A video for each project, explaining the concept and working of the same was showcased. The members of the teams i.e. students and mentors were congratulated and granted certificates by the dignitaries. It was a moment of pride for dignitaries and teams alike. Yash Sheth, entrepreneur and alumnus of SAKEC inspired the students to do start-ups and presented an app, “Let It Wag” aimed at helping injured animals. Dr. Nilakshi Jain, Research Coordinator gave a vote of thanks and motivated students to do research internships. The event concluded with another round of music and the national anthem. The project teams were left motivated and prepared for further project development. The events recording is available at: https://youtu.be/8Y2FGw9lEAw https://youtu.be/TellRtvjNDE&lt;/p&gt;', 'img_5ca43f6200feb7.94412956.jpg', 'col_5ca43f62014bd3.78905413.jpg', 'https://www.facebook.com/pg/shahanchor/photos/?tab=album&album_id=1071346313044685', 'completed', NULL),
(7, 'Student Leadership Program at Anjuman Islam School & Felicitation of Mentors', '2019-02-09', '&lt;p&gt;Shah and Anchor Kutchhi Engineering College, takes immense pleasure to thank Indian Development Foundation (IDF) for giving the opportunity of “STUDENT LEADERSHIP PROGRAM (SLP)” at Anjuman-I-Islam Girls’ School , Bandra to the students of SAKEC (Mentors for SLP). Total of 27 SAKEC-mentors were at the school for mentoring 480 school students. Highlights of the program : 1. A six day program dated 4th to 9th February 2019 where students were taught topics like Time Management, Anger Management, Public Speaking, Good company &amp;amp; Bad company, Career guidance, Community Hygiene etc, by mentors of SAKEC. 2. The students were encouraged to take initiative and be a responsible citizen of India, leaders of India by interactive sessions conducted by the mentors and also students were quite supportive as well. 3. Mentors got a new exposure to teach and learn from the young students at Anjuman-I-Islam Girls School. 4. On 8th March, 2019 the students at Anjuman-I-Islam School, were felicitated by CEO &amp;amp; National Co-ordinator (Mumbai) of IDF, Dr. Narayan B. Iyer and Dr. Beena Narayan with certificates to students. The mentors and dignitaries were felicitated with bouquet of flowers and sweet words. And memories to be cherished forever……. Dignitaries: Chief Guest Dr. Narayan B. Iyer, CEO &amp;amp; National Co-ordinator (Mumbai) Chief Guest Dr. Beena Narayan Principal of Anjuman-I-Islam Girls School Dr. Saba Patel&lt;/p&gt;', 'img_5ca44074431e64.70558016.jpg', 'col_5ca44074433e37.96780082.jpg', 'https://www.facebook.com/pg/shahanchor/photos/?tab=album&album_id=1100510310128285&__xts__%5B0%5D=68.ARBA19_6VkOmjoUo0Xh300FofjH6JLPGgmVtTcW-6D8E9EUnh1hwwF8mE0eEoZIBVcWoPcJNxv_pQ522bcCgOAIak3mrdiLRDAd', 'completed', NULL);

