INSERT INTO `rsrch_projects` (`id`, `title`, `collab`, `objectives`, `image`, `team`, `excel`, `overview`, `link`, `mous`, `type`) VALUES
(1, 'Zero Hunger', 'Roti Bank Mumbai', 'We are developing a system to build a bridge between FOOD and HUNGER.-$$-To integrate technology to benefit humanity.-$$-To help overcome disparity with social responsibility', 'img_5c90a68fad1ea9.00531881.jpg', 'team_5c90a6547660b1.37937677.jpg', '', '&lt;p&gt;The initiative, called ‘Roti Bank’, collects leftovers from restaurants, clubs and parties in Mumbai, stores it in vans and distributes it to the poor before the food gets stale. Launched by Maharashtra’s former Director General of Police D Sivanandan on 23rd December 2017 in collaboration with the Mumbai’s famous tiffin carriers ‘Dabbawalas’, the ‘Roti Bank’ claims to be getting a good response.&lt;br&gt;We at Shah &amp;amp; Anchor Kutchhi Engineering College are developing two systems for the Rotibank Mumbai:&lt;/p&gt;&lt;ol&gt;&lt;li&gt;The Mobile app&lt;/li&gt;&lt;li&gt;Roti Bank Mumbai Website&lt;/li&gt;&lt;/ol&gt;', '', 4, 'Completed'),
(2, 'Speed Ambulance: Give way for life', 'Indian Development Foundation', 'To make sure the time required by the ambulance to reach the patient from the hospital and back is minimal by providing it the fastest route available.-$$-To provide live location of the ambulance to traffic police, hospital and the patient.-$$-To connect the ambulance if stuck in traffic with the nearest traffic police.', 'img_5c94ea7642f0c0.50988535.jpg', 'team_5c94ea7643acc4.51211075.png', '', '&lt;p&gt;Speed Ambulance will be used in India to ensure the time spent by the ambulance in transporting the patient is reduced significantly thereby saving lives. If an ambulance is stuck in traffic it’s location will be sent to the nearest traffic police available in the vicinity to help the ambulance to navigate through the traffic. The live location of the ambulance will be available to the patient’s family as well as the hospital authorities to track it and monitor the time lapse.&lt;/p&gt;&lt;p&gt;In addition to that the ambulance can also capture the number plate of the car which is not making way for it.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;We at Shah &amp;amp; Anchor Kutchhi Engineering College are developing:&lt;/p&gt;&lt;p&gt;Speed Ambulance Mobile application:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Providing Live location of Ambulance to the patient and Hospital&lt;/li&gt;&lt;li&gt;To connect the ambulance driver to the nearest Traffic police&lt;/li&gt;&lt;li&gt;Providing the fastest route to the driver via Google Maps&lt;/li&gt;&lt;li&gt;Adding Security measures to allow authorized users to access respective data&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;The “ME BECOMES WE“ Event held on 4th August2018, put its stamp on the collaboration of Shah &amp;amp; Anchor Kutchhi Engineering College with Indian Development Foundation.The students and mentors were applauded for their contribution in the MoU&lt;/p&gt;', '', 1, 'Completed'),
(3, 'Test before Taste', 'Roti Bank Mumbai', 'We are using sensors to test the quality of food.-$$-To overcome challenges of developing a standard of food freshness for fulfilling social responsibility.', 'img_5c94f7de34bef3.65365907.jpg', 'team_5c94f807b33252.84503196.jpg', '', '&lt;p&gt;The initiative, called ‘Roti Bank’, collects leftovers from restaurants, clubs and parties in Mumbai, stores it in vans and distributes it to the poor before the food gets stale. We at Shah &amp;amp; Anchor Kutchhi Engineering College are using sensors to test the quality of food for the Rotibank Mumbai.&lt;br&gt;The following sensors are used to test food.&lt;/p&gt;', '', 4, 'Completed'),
(4, 'Breathe Clean', 'Indian Development Foundation', 'We are designing a system which will monitor the air quality data, analyse it and send an alert to the concern authority for necessary action-$$-To develop improved integrated tools for prediction of air pollution in mega cities.', 'img_5c950097639c16.74171493.jpg', 'team_5c9500976414b5.63580456.png', '', '&lt;p&gt;Air is essential to life. Poor air quality threatens the health of all living things from humans to plants. There are many types of air pollution, and each have a different effect on human health.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;i&gt;People experience a wide range of health effects from being exposed to air pollution so there&lt;/i&gt;e is a need to design a system which will monitor the air quality data, analyse it and send an alert to the concern authority for necessary action.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;To collect the air quality data one can design a system which contains a suitable micro-controller that reads the values from different sensors like MQ-2, MQ-7, MQ-135, LM35 and sound sensors. The microcontroller board is also attached to the Wi-Fi module which acts as a wireless medium to transmit data. The transmitted data then send to the cloud periodically which can be analysed and displayed on website in graphical manner.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;The “ ME BECOMES WE “ Event held on 4th Aug 2018, put its stamp on the The students and mentors were applauded for their contribution in the MoUc collaboration of Shah &amp;amp; Anchor Kutchhi Engineering College with IDF Mumbai.&lt;/p&gt;', '', 1, 'Completed'),
(5, 'Web of Hope', 'Indian Development Foundation', 'Indian Development Foundation ?	We are developing a website and volunteer management system to build a bridge between IDF coordinators and volunteers. -$$-To integrate technology to ease volunteer management.', 'img_5c9504afb6d3b0.16455910.jpeg', 'team_5c9504afb766a5.81630557.png', 'excel_5d412f0539f569.97444400.xlsx', '&lt;p&gt;The NGO ‘INDIAN DEVELOPMENT FOUNDATION’, undertakes various projects and events in and around Mumbai, thereby helping the people in need and working for the benefit and for upliftment of the society. Indian Development Foundation was launched by Dr. A.R.K. Pillai in 1950. We at Shah &amp;amp; Anchor Kutchhi Engineering College are developing two systems for the IDF Mumbai:&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;&amp;nbsp;&lt;/li&gt;&lt;/ul&gt;', '', 1, 'Completed'),
(6, 'Electronic Health Record Management System for Bombay Leprosy Project', 'Bombay Leprosy Project', 'To migrate the present record keeping system at BLP from hand written paper based forms to a digital database-$$-Carry out health care data management and analysis; and long term follow-up of leprosy patients who default from treatment.-$$-To help Doctors,volunteers and Patients for monitoring, tracking and assisting health records of leprosy patients treated by Bombay Leprosy Project', 'img_5c97897c501674.77528444.png', 'team_5c97897c509ae3.50981521.jpg', '', '&lt;p&gt;Bombay Leprosy Project(BLP) is an NGO which deals with patients having Leprosy, They have a team of volunteers and Doctors who find and treat people having Leprosy. Leprosy is one of the oldest diseases known to mankind and India has the maximum number of leprosy cases in the world. The objective of the NGO is to eradicate leprosy from India.&lt;br&gt;We at Shah &amp;amp; Anchor Kutchhi Engineering College want to contribute to their efforts by this project:&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;The proposed system will a web and mobile based application which contribute to maintain electronic health care records for leprosy patients&lt;/li&gt;&lt;li&gt;The system/App will manage patient’s history by providing smart cards.&lt;/li&gt;&lt;li&gt;It will provide comprehensive management of leprosy patients at referral center and clinics in major government, municipal and private hospitals.&lt;/li&gt;&lt;li&gt;The Health records system will be deployed at Bombay Leprosy Project office.&lt;/li&gt;&lt;li&gt;The system /App will track the defaulter leprosy patients who failed to follow up at various center.&lt;/li&gt;&lt;li&gt;It allows users to report issues they face at leprosy facilities, and maps leprosy facilities centers available near a user’s location.&lt;/li&gt;&lt;li&gt;Users will also be able to track issues they have reported and raise follow-up queries.&lt;/li&gt;&lt;/ul&gt;', '', 3, 'Completed'),
(7, 'Fire Fighter Robot', 'Indian Development Foundation', 'We are developing a system which act as an advantage to deal with the serious fire conditions of the society-$$-To integrate technology to benefit humanity-$$-This technology could help prevent huge fire disasters', 'img_5c978d07c41546.27152509.jpg', 'team_5c978d07c4df22.40210855.png', '', '&lt;p&gt;Safety and speed are two of the most important aspects of any rescue operation. When a building or an area is subject to a fire, it can be very dangerous for any of the rescuing parties to assess the situation themselves without being subject to harm. A great alternative to this would be to use robots. Thus the problem by definition is being able to locate and extinguish a fire with minimal assistance of human beings and as fast as possible using a robot. This is to reduce the likelihood of anyone being injured as well as increase the promptness of putting out the fire due to the fact that a robot should not be affected by issues such as smoke or lack of oxygen.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;We at Shah &amp;amp; Anchor Kutchhi Engineering College are developing a system which will consist of various things and features:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;The robot can move automatically from place to place wirelessly&lt;/li&gt;&lt;li&gt;The robot can operate in dual mode as well that is manually&lt;/li&gt;&lt;li&gt;Automatic fire detection system&lt;/li&gt;&lt;/ul&gt;', '', 1, 'Completed');

